import React from "react"

function Books ({ data }) {
    return (
        <div>
            {data.map((book) => (
                <div key={book.isbn}>
                    <h3>{book.title}</h3>
                    <img src={book.thumbnailUrl} alt={book.title} />
                    <p>Authors: {book.authors.join(", ")}</p>
                    <p>ISBN: {book.isbn}</p>
                    <p>Status: {book.status}</p>
                </div>
            ))}
        </div>
    );
}



